import './App.css';


const App = () => {
  return (
    <div>
      <header>
        <img src="https://upload.wikimedia.org/wikipedia/commons/b/be/Lineage_OS_Logo.png" alt="" />
      </header>
      <nav>
       <div>Prof</div> 
       <div>Mess</div>
       <div></div> 
       <div></div>
         </nav>
      <article>Main content</article>
      <footer>about us</footer>
    </div>
  );
}


export default App;
